        numMap.put("two", 2);
        numMap.put("three", 3);
        numMap.put("four", 4);
        numMap.put("five", 5);
        numMap.put("six", 6);
        numMap.put("seven", 7);
        numMap.put("eight", 8);
        numMap.put("nine", 9);
        // Sort the array based on the integer value of each number
        Arrays.sort(numArray, Comparator.comparingInt(numMap::get));
        // Join the sorted array back into a string and return it
